INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `BroadcastTextID`, `comment`) VALUES
(71658, x, x, 'Stop this madness! You have no idea what you''re dealing with!', 14, 0, 100, 5, 0, 38986, 0, 'Kor''kron Jailer to 0'),
(71658, x, x, 'Intruders! I will lock you in a cell with the rest of the filth.', 14, 0, 100, 5, 0, 39032, 0, 'Kor''kron Jailer to 0'),
(71658, x, x, 'What''s going on in here? Get that thing back in its cage!', 14, 0, 100, 5, 0, 38985, 0, 'Kor''kron Jailer to 0'),
(71889, x, x, 'Hey, we recording?  Yeah?  Okay.  Goblin-Titan control module starting up, please stand back.', 14, 0, 100, 0, 0, 38479, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(71889, x, x, 'Checking out the datas, hold on a second will ya.', 14, 0, 100, 0, 0, 38480, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(71889, x, x, 'Oh, now you did it, that was really really really not the correct input code.', 14, 0, 100, 0, 0, 38481, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(71889, x, x, 'Activating GB-11010 "Armageddon"-class defense systems. Hey, does anybody know if we''re zoned for this?', 14, 0, 100, 0, 0, 38482, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(71889, x, x, 'Initiating system reset. Module 1 at 50%%. Hey, system reset requires two modules to complete.', 14, 0, 100, 0, 0, 38473, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(71889, x, x, 'Module 1''s all prepared for system reset.', 14, 0, 100, 0, 0, 38474, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(71889, x, x, 'Initiating system reset. Module 2 at 50%%. Hey, system reset requires two modules to complete.', 14, 0, 100, 0, 0, 38475, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(71889, x, x, 'Module 2''s all prepared for system reset.', 14, 0, 100, 0, 0, 38476, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(71889, x, x, 'System resetting. Don''t turn the power off, or the whole thing will probably explode.', 14, 0, 100, 0, 0, 38476, 0, 'Secured Stockpile of Pandaren Spoils to Player'),
(72728, x, x, 'For Warchief Garrosh!', 14, 0, 100, 53, 0, 0, 0, 'Kor''kron Blood Axe to 0'),
(72728, x, x, 'You will fall before the true Horde!', 14, 0, 100, 53, 0, 0, 0, 'Kor''kron Blood Axe to 0'),
(72728, x, x, 'None can stand against Garrosh!', 14, 0, 100, 60, 0, 0, 0, 'Kor''kron Blood Axe to 0'),
(71742, x, x, 'Stop, my brothers! Do you not see the beast of burden before you?', 14, 0, 100, 25, 0, 0, 0, 'Akolik to Player'),
(71742, x, x, 'Do you not see the light of Kros? He has been defiled!', 14, 0, 100, 5, 0, 0, 0, 'Akolik to Player'),
(73195, x, x, 'It''s busting out of the cage!  Arm the shock collar, get that thing under control!', 14, 0, 100, 0, 0, 0, 0, 'Kor''kron Jailer to Player'),
(73195, x, x, 'Shock it until it can''t move anymore!  It''s causing a riot in here!', 14, 0, 100, 0, 0, 0, 0, 'Kor''kron Jailer to Player'),
(73195, x, x, 'Deal with the devilsaur first, then we''ll lock the rest up!', 14, 0, 100, 5, 0, 0, 0, 'Kor''kron Jailer to Player'),
(71501, x, x, 'Security system deactivated.  Welcome back Siegecrafter Blackfuse.', 14, 0, 100, 0, 0, 38478, 0, 'Unsecured Stockpile of Pandaren Spoils to Secured Stockpile of Pandaren Spoils'),
(71501, x, x, 'Have a great day and don''t let the door hit you on the way out.', 14, 0, 100, 0, 0, 38472, 0, 'Unsecured Stockpile of Pandaren Spoils to Secured Stockpile of Pandaren Spoils'),
(71744, x, x, 'Run for it!!!', 14, 0, 100, 0, 0, 0, 0, 'Skumblade Captive to Player'),
(71744, x, x, 'Taste his flesh! Drink his blood!', 14, 0, 100, 0, 0, 0, 0, 'Skumblade Captive to Player'),
(71744, x, x, 'By the blood of Kros!', 14, 0, 100, 0, 0, 0, 0, 'Skumblade Captive to Player'),
(71529, x, x, '%s detects a cluster of injured enemies and goes into a  |cFFFF0404|Hspell:143440|h[Blood Frenzy]|h|r!', 41, 0, 100, 0, 0, 38986, 0, 'Thok the Bloodthirsty to 0'),
(71529, x, x, '%s reels in pain and leers angrily at $n.', 41, 0, 100, 0, 0, 0, 0, 'Thok the Bloodthirsty to Akolik'),
(71529, x, x, '%s detects a cluster of injured enemies and goes into a  |cFFFF0404|Hspell:143440|h[Blood Frenzy]|h|r!', 41, 0, 100, 0, 0, 39032, 0, 'Thok the Bloodthirsty to 0'),
(71529, x, x, '%s reels in pain and leers angrily at $n.', 41, 0, 100, 0, 0, 0, 0, 'Thok the Bloodthirsty to Waterspeaker Gorai'),
(71529, x, x, '%s detects a cluster of injured enemies and goes into a  |cFFFF0404|Hspell:143440|h[Blood Frenzy]|h|r!', 41, 0, 100, 0, 0, 38985, 0, 'Thok the Bloodthirsty to 0'),
(71529, x, x, '%s reels in pain and leers angrily at $n.', 41, 0, 100, 0, 0, 0, 0, 'Thok the Bloodthirsty to Montak'),
(71763, x, x, 'Burn them all! Burn them to ash!', 14, 0, 100, 0, 0, 39142, 0, 'Montak to Player'),
(71749, x, x, 'Thank you, friends. I will lend what aid I can.', 14, 0, 100, 1, 0, 38933, 0, 'Waterspeaker Gorai to Player');
